export const data = {
    espanol: {
        function: {
            description: [
                "Esta función te ayudará a entender mejor el contenido de esta web.",
                "Cada vez que te encuentres confundido, presiona el icono",
                "icon",
                "que está en la barra navegadora.",
                "Que tengas un buen viaje!"
            ],
            function: "nuevos horizontes = ( ) => imagen => pregunta => nuevos horizontes ( )"
        },
        about: [
            "Hay quien dice que el caminar por nuevas sendas provoca una dislocación de la mirada. Si no la provoca, al menos invita a migrarla; sugiere una reeducación de la percepción.",
            "A la contemplacíon de nuevas cosmovisiones, le sucede la configurar nuevas imágenes, nuevos interrogantes y nuevos horizontes.",
            "Vale decir, la imagen deviene pregunta, y la pregunta es el combustible en el camino."
        ]

    },
    english: {
        function: {
            description: [
                "This function can help you to understand deeper the content of this website.",
                "Each time you are confused, press the icon",
                "icon",
                "which is in the navigation bar.",
                "Have a nice trip!"],
            function: "new horizons = ( ) => images => questions => new horizons ( )"
        },
        about: [
            "Some people say that walking new paths dislocates one’s stare. If it doesn’t do so, at least, it invites the viewer to migrate their view; it suggests a retraining of perception.",
            "Contemplating new world views is the prelude to configuring new images, raising new questions, drawing new horizons.",
            "In other words, the image turns into question, and the question is the fuel along my path."],

    },

    social_nets: [
        { instagram: ["fab fa-instagram", "https://www.instagram.com/arturorugh/"] },
        { vimeo: ["fab fa-vimeo", "https://vimeo.com/arturorugh"] },
        { youtube: ["fab fa-youtube", "https://www.youtube.com/channel/UCZXanI-JKsslropcdWz479A?view_as=subscriber"] },
    ]

}
